import logo from './logo.svg';
import './App.css';
import Form from './components/form';
import { Info } from './components/info';
import { useState } from 'react';

function App() {
  const [info,setInfo] = useState([]);
  return (
    <div className="App">
     <Form setInfo={setInfo}/>
     <Info info = {info}/>
    </div>
  );
}

export default App;
